import React from 'react';

const Login = () => {
    return (
        <div className="loginBanner container-fluid">
            <div className="row just">
                <div className="loginDiv bg-warning col-sm-6 col-md-3 mx-auto">
                    <img className="logo" src={require('../images/globe.png')} alt="logo" />
                </div>
            </div>
        </div>
    )
}

export default Login;
